$.fn.addRatioClasses=function(b){b=$.extend({body:true,addRatioClassToBody:true,elList:[]},b);var d=b,c=$(window).height(),a=$(window).width();if(d.elList.length!==0){$.each(d.elList,function(f,e){$(e).addClass("h"+$(e).height()+" w"+$(e).width())})}if(d.addRatioClassToBody){if(a/c==16/9){$("body").addClass("ratio_16_9")}else{if(a/c==4/3){$("body").addClass("ratio_4_3")}else{$("body").addClass("noRatio")}}}};